sap.ui.define(
  [
    "sap/ui/core/mvc/Controller",
    "sap/ui/core/Fragment",
    "../../utils/DMSHandler",
    "sap/m/MessageToast",
    "salidademateriales/utils/Utils",
    "salidademateriales/libs/html2pdf",
  ],
  function (Controller, Fragment, DMSHandler, MessageToast, Utils) {
    "use strict";

    return Controller.extend(
      "salidademateriales.controller.fragments.SignatureHandler",
      {
        _oResourceBundle: null,

        /**
         * Inicializa el handler con el contexto del controlador principal.
         * @param {sap.ui.core.mvc.View} oView La view donde se verá el dialog .
         * @param {string} sModelName El nombre del modelo con el que trabajará el handler.
         */
        init: function (oView, sModelName) {
          this._oView = oView;
          this._sModelName = sModelName;
          this._signaturePad = null;
          this._signatureDialog = null;
          this._dmsHandler = DMSHandler;

          this._oResourceBundle = this._oView
            .getController()
            .getOwnerComponent()
            .getModel("i18n")
            .getResourceBundle();
        },

        onAfterRenderingCanvas() {
          if (!this._signaturePad) {
            const canvas = document.getElementById("signatureCanvas");
            if (!canvas) {
              console.log("No se pudo encontrar el canvas de la firma");
              return;
            }
            this._signaturePad = new window.SignaturePad(canvas);
          }
        },

        async onOpenSignatureCanvas() {
          const sFragmentId = this._oView.createId("signatureDialog");

          if (!this._signatureDialog) {
            this._signatureDialog = await Fragment.load({
              id: sFragmentId,
              name: "salidademateriales.view.fragments.dialogs.SignDialog",
              controller: this,
            }).then((oSignatureDialog) => {
              this._oView.addDependent(oSignatureDialog);
              return oSignatureDialog;
            });
            const deviceModel = this._oView.getModel("device");
            const { width } = deviceModel.getProperty("/resize");
            const canvasWidth = width > 600 ? 500 : 300;
            const canvasHeight = width > 600 ? 300 : 180;

            const oHtmlContainer = Fragment.byId(
              sFragmentId,
              "signatureCanvasContainer"
            );

            oHtmlContainer?.setContent(
              `<div style="border: 1px solid #ccc;"><canvas id='signatureCanvas' width='${canvasWidth}' height='${canvasHeight}'></canvas><div id='canvasLine' style='width: ${
                canvasWidth - 30
              }px; height: 1px; position: relative;left: 15px; bottom: 30px;background-color: black;'></div></div>`
            );
          }
          this._signatureDialog.open();
        },

        changeCanvasSize(oEvent) {
          const deviceModel = this.getView().getModel("device");
          const { width } = deviceModel.getProperty("/resize");
          const canvasWidth = width > 600 ? 500 : 300;
          const canvasHeight = width > 600 ? 300 : 180;
          const canvas = document.getElementById("signatureCanvas");
          const line = document.getElementById("canvasLine");
          canvas.style.height = canvasHeight + "px";
          canvas.style.width = canvasWidth + "px";
          canvas.height = canvasHeight;
          canvas.width = canvasWidth;
          line.style.width = canvasWidth - 30 + "px";
        },

        onCloseSignatureDialog() {
          if (this._signaturePad) {
            this._signaturePad.clear();
          }
          this._signatureDialog.close();
        },

        onClearSignature() {
          if (this._signaturePad) {
            this._signaturePad.clear();
          }
        },

        async onSaveSignature() {
          this._signatureDialog.setBusy(true);

          if (!this._signaturePad || this._signaturePad.isEmpty()) {
            MessageToast.show(
              this._oResourceBundle.getText("messageToastMissingSignature")
            );
            this._signatureDialog.setBusy(false);
            return;
          }

          const oTargetModel = this._oView.getModel(this._sModelName);
          const base64 = this._signaturePad.toDataURL();

          oTargetModel.setProperty("/Firma", base64);

          const oMatDocSelec = oTargetModel.getProperty(
            "/DocumentoSeleccionado"
          );
          if (oMatDocSelec && !oMatDocSelec.Firmado && oMatDocSelec.Pdf) {
            oMatDocSelec.Pdf = await this._addSignatureToVale(
              oMatDocSelec,
              base64
            );
            if (oMatDocSelec.Pdf != null) {
              const sReservaId = oTargetModel.getProperty("/Reserva/Id");

              //Generar PDF Reserva
              const sBase64DocReserva = await this._generarPdfReserva();
              const sBase64DocReservaSigned = await this._addSignatureToReserva(sBase64DocReserva, base64);

              //Fusionar PDFs
              const { PDFDocument } = window.PDFLib;

              const pdf1Bytes = Uint8Array.from(atob(oMatDocSelec.Pdf), (c) =>
                c.charCodeAt(0)
              );
              const pdf2Bytes = Uint8Array.from(atob(sBase64DocReservaSigned), (c) =>
                c.charCodeAt(0)
              );

              const oPdf1Doc = await PDFDocument.load(pdf1Bytes); //vale
              const oPdf2Doc = await PDFDocument.load(pdf2Bytes); //reserva

              // Copiar todas las páginas del primer PDF al segundo
              const aCopiedPages = await oPdf2Doc.copyPages(
                oPdf1Doc,
                oPdf1Doc.getPageIndices()
              );
              aCopiedPages.forEach((page) => oPdf2Doc.addPage(page));

              // Guardar el PDF fusionado como un array de bytes (Uint8Array)
              const mergedPdfBytes = await oPdf2Doc.save();

              let binaryString = "";
              for (let i = 0; i < mergedPdfBytes.length; i++) {
                binaryString += String.fromCharCode(mergedPdfBytes[i]);
              }
              const mergedBase64 = btoa(binaryString);
              oMatDocSelec.Pdf = mergedBase64;

              //Logica para guardar en DMS
              //const blob = Utils.base64ToBlob(oMatDocSelec.Pdf, "application/pdf");
              const blob = Utils.base64ToBlob(mergedBase64, "application/pdf");

              const oResult = await this._dmsHandler.uploadObject(
                `root/Vale_Acomp_Reservas/${sReservaId}`,
                oMatDocSelec.Numero,
                `${oMatDocSelec.Numero}.pdf`,
                blob
              );
              if (oResult.error) {
                switch (oResult.error.status) {
                  case 409:
                    MessageToast.show(
                      this._oResourceBundle.getText(
                        "messageToastErrorDMSObjAlreadyExists"
                      )
                    );
                    this._signatureDialog.setBusy(false);
                    throw new Error(oResult.error);
                  case 401:
                    MessageToast.show(
                      this._oResourceBundle.getText(
                        "messageToastErrorDMSInvalidToken"
                      )
                    );
                    this._signatureDialog.setBusy(false);
                    throw new Error(oResult.error);
                  default:
                    MessageToast.show(
                      this._oResourceBundle.getText(
                        "messageToastErrorDMSDefault"
                      )
                    );
                    this._signatureDialog.setBusy(false);
                    throw new Error(oResult.error);
                }
              }

              oMatDocSelec.Firmado = true;
              oMatDocSelec.DMSId = oResult.objId;
              oTargetModel.setProperty("/DocumentoSeleccionado", oMatDocSelec);

              //Logica para actualizar modelo en detalles reserva
              const aDocumentos = oTargetModel.getProperty("/Documentos");
              if (aDocumentos && aDocumentos.length > 0) {
                const index = aDocumentos.findIndex(
                  (oDocumento) =>
                    parseInt(oDocumento.Numero) ===
                    parseInt(oMatDocSelec.Numero)
                );
                if (index > -1) {
                  oTargetModel.setProperty(
                    `/Documentos/${index}`,
                    oMatDocSelec
                  );
                }
              }
            }
          }

          this._signatureDialog.setBusy(false);
          this._signaturePad.clear();
          this._signatureDialog.close();
        },
        async _addSignatureToVale(oMatDocSelec, sFirmaBase64) {
          const sPdfBase64 = oMatDocSelec.Pdf;
          let imgBase64Clean = sFirmaBase64;

          if (sFirmaBase64.indexOf("base64,") > -1) {
            imgBase64Clean = sFirmaBase64.split("base64,")[1];
          }
          const isPng =
            sPdfBase64.startsWith("data:image/png") ||
            imgBase64Clean.startsWith("iVBOR");

          try {
            const pdfBytes = Uint8Array.from(atob(sPdfBase64), (c) =>
              c.charCodeAt(0)
            );

            const { PDFDocument } = window.PDFLib;
            const pdfDoc = await PDFDocument.load(pdfBytes);

            let imageEmbed;
            if (isPng) {
              imageEmbed = await pdfDoc.embedPng(imgBase64Clean);
            } else {
              imageEmbed = await pdfDoc.embedJpg(imgBase64Clean);
            }

            const pages = pdfDoc.getPages();
            const lastPage = pages[pages.length - 1];

            const imgDims = imageEmbed.scale(0.2);
            lastPage.drawImage(imageEmbed, {
              x: 65,
              y: 30,
              width: imgDims.width,
              height: imgDims.height,
            });

            const modifiedPdfBase64 = await pdfDoc.saveAsBase64();
            return modifiedPdfBase64;
          } catch (err) {
            console.error("Error al modificar pdf: ", err);
            return null;
          }
        },

        async _generarPdfReservaFromHtml() {
          const oTargetModel = this._oView.getModel(this._sModelName);
          const oMatDocSelec = oTargetModel.getProperty(
            "/DocumentoSeleccionado"
          );

          const sReservaId = oTargetModel.getProperty("/Reserva/Id") || "";
          const sOrdenId = oTargetModel.getProperty("/Reserva/Orden") || "";
          const sCreador = oTargetModel.getProperty("/Reserva/Usuario") || "";
          const sCentroCoste =
            oTargetModel.getProperty("/Reserva/CostCenter") || "";
          const oUsuarioModel = oComponent.getModel("Usuario");
          const sUsuarioName = `${oUsuarioModel.getProperty(
            "/Nombre"
          )} ${oUsuarioModel.getProperty("/Apellido")}`;
          const sDestinatario = oMatDocSelec.Dest || "";
          const dFechaNow = new Date();
          const sFechaNow = dFechaNow.toLocaleDateString("es-ES");
          const sHoraNow = dFechaNow.toLocaleTimeString("es-ES", {
            hour: "2-digit",
            minute: "2-digit",
          }); // ej: 14:30
          //Generar Documento Reserva
          const sTemplate = await fetch(
            sap.ui.require.toUrl(
              "salidademateriales/templates/reservaDocument.html"
            )
          ).then((res) => res.text());
          let sHtml = sTemplate
            .replaceAll("{{fechaG}}", sFechaNow)
            .replaceAll("{{horaG}}", sHoraNow)
            .replaceAll("{{nroReserva}}", sReservaId)
            .replaceAll("{{nroOrden}}", sOrdenId)
            .replaceAll("{{nombCreadorReserva}}", sCreador)
            .replaceAll("{{centroCoste}}", sCentroCoste)
            .replaceAll("{{nombUsuario}}", sUsuarioName)
            .replaceAll("{{destinatario}}", sDestinatario);

          return new Promise((resolve) => {
            setTimeout(async () => {
              try {
                const opt = {
                  margin: 10,
                  filename: `Reserva_${sReservaId}.pdf`,
                  image: { type: "png", quality: 1 },
                  html2canvas: { scale: 3, useCORS: true },
                  jsPDF: { unit: "mm", format: "a4", orientation: "portrait" },
                };

                const pdf2ArrayBuffer = await html2pdf()
                  .from(sHtml)
                  .set(opt)
                  .outputPdf("arraybuffer");
                resolve(pdf2ArrayBuffer);
              } catch (oError) {
                console.error("Error dentro de html2pdf:", oError);
                reject(oError);
              }
            }, 1000);
          });
        },
        async _generarPdfReserva() {
          const sBase64 =
            "";
          const oTargetModel = this._oView.getModel(this._sModelName);
          const oMatDocSelec = oTargetModel.getProperty(
            "/DocumentoSeleccionado"
          );

          const oComponent = this._oView.getController().getOwnerComponent();
          const sReservaId = oTargetModel.getProperty("/Reserva/Id") || "";
          const sOrdenId = oTargetModel.getProperty("/Reserva/Orden") || "";
          const sCreador = oTargetModel.getProperty("/Reserva/Usuario") || "";
          const sCentroCoste =
            oTargetModel.getProperty("/Reserva/CostCenter") || "";
          const sDestinatario = oMatDocSelec.Dest || "";
          const dFechaNow = new Date();
          const sFechaNow = dFechaNow.toLocaleDateString("es-ES");
          const sHoraNow = dFechaNow.toLocaleTimeString("es-ES", {
            hour: "2-digit",
            minute: "2-digit",
          }); // ej: 14:30

          const oUsuarioModel = oComponent.getModel("Usuario");
          const sUsuarioName = `${oUsuarioModel.getProperty(
            "/Nombre"
          )} ${oUsuarioModel.getProperty("/Apellido")}`;
          const sPaginas = "1 de 1";

          const { PDFDocument } = window.PDFLib;

          try {
            const pdfBytes = Uint8Array.from(atob(sBase64), (c) =>
              c.charCodeAt(0)
            );
            const pdfDoc = await PDFDocument.load(pdfBytes);
            const form = pdfDoc.getForm();

            form.getTextField("reservaField").setText(sReservaId);
            form.getTextField("creadaPorField").setText(sCreador);
            form.getTextField("guardadoPorField").setText(sUsuarioName);
            form.getTextField("ordenField").setText(sOrdenId);
            form.getTextField("centroCostoField").setText(sCentroCoste);
            form.getTextField("destinatarioField").setText(sDestinatario);
            form.getTextField("paginasField").setText(sPaginas);
            form.getTextField("nombreEntregadorField").setText(sUsuarioName);
            form.getTextField("nombreAutorizadorField").setText(sCreador);
            form.getTextField("nombreRecibiField").setText(sDestinatario);
            form
              .getTextField("fechaHoraField")
              .setText(sFechaNow + " " + sHoraNow);

            form.flatten();
            const sBase64Filled = await pdfDoc.saveAsBase64();
            return sBase64Filled;
          } catch (oError) {
            console.error(
              "Error al generar documento Reserva: ",
              oError.message
            );
            return "";
          }
        },
        async _addSignatureToReserva(sReservaPdf, sFirmaBase64) {
          let imgBase64Clean = sFirmaBase64;

          if (sFirmaBase64.indexOf("base64,") > -1) {
            imgBase64Clean = sFirmaBase64.split("base64,")[1];
          }
          const isPng =
            sReservaPdf.startsWith("data:image/png") ||
            imgBase64Clean.startsWith("iVBOR");

          try {
            const pdfBytes = Uint8Array.from(atob(sReservaPdf), (c) =>
              c.charCodeAt(0)
            );

            const { PDFDocument } = window.PDFLib;
            const pdfDoc = await PDFDocument.load(pdfBytes);

            let imageEmbed;
            if (isPng) {
              imageEmbed = await pdfDoc.embedPng(imgBase64Clean);
            } else {
              imageEmbed = await pdfDoc.embedJpg(imgBase64Clean);
            }

            const pages = pdfDoc.getPages();
            const lastPage = pages[pages.length - 1];

            const imgDims = imageEmbed.scale(0.25);
            lastPage.drawImage(imageEmbed, {
              x: 240,
              y: 65,
              width: imgDims.width,
              height: imgDims.height,
            });

            const modifiedPdfBase64 = await pdfDoc.saveAsBase64();
            return modifiedPdfBase64;
          } catch (err) {
            console.error("Error al modificar pdf: ", err);
            return null;
          }
        }
      }
    );
  }
);
